import { createApp } from "vue";
import VueI18n from "vue-i18n";
import App from "./App.vue";
import messages from "./locales";

export const i18n = new VueI18n({
  locale: "en",
  fallbackLocale: "en",
  messages,
});

createApp(App).use().mount("#app");
